import React from 'react'
import { Box, ButtonGroup, Card, Button, Container, Accordion, useTheme, makeStyles, Divider, AccordionSummary, Typography, AccordionDetails } from '@material-ui/core'
import { Line } from 'react-chartjs-2'
// import 'date-fns';
// import MomentUtils from '@date-io/moment';
// import { KeyboardDatePicker, MuiPickersUtilsProvider } from "@material-ui/pickers";
// import moment from 'moment';

  const useStyles = makeStyles((theme) => ({
    typoGraphy: {
        fontSize: '12px'
    },
}))
function Chart() {
    // const [selectedDate, setSelectedDate] = React.useState(moment());
    const classes = useStyles()
    const labels = ['Dec10', 'Dec11', 'Dec12', 'Dec13', 'Dec15', 'Dec16', 'Dec17', 'Dec18']
    const data = {
        labels: labels,
        datasets: [
            {
                label: 'Type 1',
                borderColor: ['#2b79ff'],
                data: [0.65, 0.59, 0.80, 0.81, 0.56, 0.55, 0.40, 0.50, 0.70, 0.75, 0.80, 0.85],
            },
            {
                label: 'Type 2',
                borderColor: ['#ff2b2b'],
                data: [0.60, 0.67, 0.82, 0.70, 0.40, 0.30, 0.40, 0.50, 0.80, 0.85, 0.90, 0.90],
            },
            {
                label: 'Type 3',
                borderColor: ['#a72bff'],
                data: [0.30, 0.40, 0.50, 0.20, 0.40, 0.35, 0.35, 0.40, 0.50, 0.70, 0.75, 0.90],
            },
        ]
    };
    // const handleDateChange = (date) => {
    //     setSelectedDate(date);
    //   };

    return (
        <div>
            <Card className="p-4">
        <div style={{ display: "flex" }}>
          <Typography style={{ fontSize: "25px" }}>Analytics</Typography>
          <ButtonGroup size="small" style={{ marginLeft: "auto" }}>
            <Button>
                Heading 1 <br></br>
                24,350
            </Button>
            <Button>
                Heading 2 <br></br>
                12,360
            </Button>
            <Button>
                 Heading 3 <br></br>
                10,671
            </Button>
            <Button>
                 Heading 4 <br></br>
                6,562
            </Button>
          </ButtonGroup>
        </div>
        <Line
          className="mt-4"
          data={data}
          options={{ responsive: true, title: "Thickness" }}
        />
      </Card>
        </div>
    )
}

export default Chart
